import React from "react";

const WaitList = () => {
  return (
    <>
      <Container>
      <Title>
        Make AI work for <span style={{ color: 'pink' }}>your</span>{' '}
        <span style={{ color: 'purple' }}>brand</span> from today.
      </Title>
      <Button>Join Waitlist</Button>
    </Container>
     
      
    </>
  );
};

export default WaitList;
